import React from "react";

function CreateArea(){

    return (
        <div>
            <form>
                <input 
                    name = "title"
                    placeholder="Title"
                />
                <textarea 
                    name = "content"
                    placeholder="content"
                />
                <button>Add</button>
            </form>
        </div>
    );
}

export default CreateArea;
